import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Register from "./Register";
import Login from "./Login";
function App() {
  return (
    <Router>
        <Routes>
          <Route path="/" element={<Register />}></Route>
          {/* <Route path="/login" element={<Login />}></Route> */}
        </Routes>
    </Router>
  );
}

export default App;
